import React from 'react'
import Logo from "./0.jpeg";
import './Post.css';

function Post() {
    return (
        <div className="post">
            {/* Username */}
            <h3>Username</h3>

            {/* Image*/}
            <img src={Logo} className="post__image"></img>

            {/* Username + Caption*/}
            <h4>Username: Caption</h4>
        </div>
    )
}

export default Post
